import React from 'react';
import DessertsInfo from './DessertsInfo';
import SuppliedDesserts from './SuppliedDesserts';

const Desserts = () => {
  return (
  <React.Fragment>
    
     <DessertsInfo />
     <SuppliedDesserts />
     
  </React.Fragment>
  )};

export default Desserts;
